    return new Date(dateParts[2], 
                    dateParts[0] - 1, 
                    dateParts[1], 
                    0, 
                    0, 
                    0);
}

function isNewUserInExperiment(expStartDate, expDurationInDays) {

    if (expDurationInDays <= 0) { return false; }

    var installDate = new Date();
    installDate.setDate(installDate.getDate() - context.device.daysSinceAppInstall);

    var utcStart = dateFromUTCDateStr(expStartDate)

    if (utcStart == null) { return false; }

    var utcEnd = dateFromUTCDateStr(expStartDate)
    utcEnd.setDate(utcStart.getDate() + expDurationInDays)

    return installDate.getTime() >= utcStart.getTime() && installDate.getTime() <= utcEnd.getTime();
}

